declare global {
	interface Window {
		google: any
	}
}

import React from "react"
import { connect } from "react-redux"
import { bindActionCreators } from "redux"
import { Marker } from "@react-google-maps/api"
import { addFish } from "../store/fish/action"
import { GoogleMap, LoadScript } from "@react-google-maps/api"

const position = { lat: 33.772, lng: -117.214 }

export interface MapProps {
	fish: []
}

export class Map extends React.Component<MapProps, any> {
	constructor(props) {
		super(props)

		this.state = {
			fish: [
				{
					id: Date.now(),
					url:
						"https://developers.google.com/maps/documentation/javascript/examples/full/images/beachflag.png",
				},
			],
		}
	}

	Generatefish = () => {
		return this.state.fish.map((marker) => {
			return (
				<Marker
					position={position}
					icon={{
						url: marker.url,
					}}
				>
					<h1>Marker</h1>
				</Marker>
			)
		})
	}

	render() {
		return (
			<LoadScript googleMapsApiKey="AIzaSyAzNAcbkbNofJb40BYJ75D1WnYtQ_LbZr4" style={{
				width: "100%",
				height: "100%"
			}}>
				<GoogleMap
					mapContainerStyle={{
						width: "100%",
						height: "100%",
					}}
					center={position}
					zoom={10}
				>
					{this.Generatefish()}
				</GoogleMap>
			</LoadScript>
		)
	}
}

const mapDispatchToProps = (dispatch) => {
	return {
		addFish: bindActionCreators(addFish, dispatch),
	}
}

export default connect(null, mapDispatchToProps)(Map)
